== 简介 ==
'''海色少女に魅せられて'''是{{coloredlink|blue|园田海未}}（CV：[[三森铃子]]）的第一张个人专辑，发售于2011年11月23日。专辑包含了新曲「私たちは未来の花」和广播剧。


